import UserFinder from "./components/UserFinder";


const DUMMY_USERS = [
	{ id: "u1", name: "Max" },
	{ id: "u2", name: "Manuel" },
	{ id: "u3", name: "Julie" },
];

function App() {
  const usersContext = {
    users: DUMMY_USERS
  }
	return (
		<UsersContext.Provide value={usersContext}>
			<UserFinder />
		</UsersContext.Provide>
	);
}

export default App;
